import styled from 'styled-components';

export const LoginContainer = styled.div`
    background: #fff;
    display: flex;
    justify-content: center;
    align-items: flex-start;
    padding: 0px 20px;
    height: 700px;
    position: relative;
    z-index: 1;
`;

export const LoginContent = styled.div`
    display: flex;
    flex-flow: column;
    justify-content: flex-start;
    align-items: flex-start;
    max-width: 800px;
    position: absolute;
    padding: 0px 16px;
    z-index: 4;
`;

export const ButtonContainer = styled.div`
    display: flex;
    flex-flow: row;
    justify-content: space-between;
    width: 100%;
    padding: 20px;
`;

export const ButtonContainerR = styled.div`
    display: flex;
    flex-flow: row;
    align-self: flex-end;
    // width: 100%;
    padding: 20px;
`;

export const Button = styled.button`
    background-color: transparent;
    color: transparent;
    appearance: none;
    border: 0px;
    border-radius: 3px;
    cursor: pointer;
    padding: 0px 6px;
    outline: none;
`;

export const LoginH1 = styled.h1`
    color: #000;
    font-size: 15px;
    text-align: left;
    padding: 30px;
`;
